class Solution:
    def shortestSubarray(self, nums: List[int], k: int) -> int:

        prefix = []
        tmp = 0
        for i in range(len(nums)):
            tmp += nums[i]
            prefix.append(tmp)

        ans = float('inf')

        st = [(0, -1)]

        tmp = 0
        for i in range(len(nums)):
            tmp += nums[i]
            while st and tmp <= st[-1][0]:
                st.pop()
            st.append((tmp, i))

            idx = bisect.bisect_right(tuple(x[0] for x in st), prefix[i] - k) - 1

            # if idx >= 0:
            #     idx = 0
            if idx < 0:
                continue

            val, start = st[idx]
            if prefix[i] - val >= k:
                if i-start+1 <= ans:
                    ans = min(ans, i-start)
                    pass

        return ans if ans != float('inf') else -1
